import React from 'react'
import { graphql, useStaticQuery } from 'gatsby';
import { Container, Image } from 'react-bootstrap';
import styles from "./index.module.scss"
import Img from "gatsby-image"



interface Props { }
const section = (props: Props) => {
  const data = useStaticQuery(graphql`
  query {
    svg: file(relativePath: { eq: "homepage/Path.svg" }) {
      childImageSharp {
        fluid(maxWidth: 1000, quality: 100) {
          ...GatsbyImageSharpFluid
        }
      }
      extension
      publicURL
    }
      mobileImage: file(relativePath: { eq: "homepage/section1/main-mobile.png" }) {
        childImageSharp {
          fluid(maxWidth: 1000, quality: 100) {
            ...GatsbyImageSharpFluid
          }
        }
      }
      desktopImage: file(
        relativePath: { eq: "homepage/section1/main.png" }
      ) {
        childImageSharp {
          fluid(maxWidth: 2000, quality: 100) {
            ...GatsbyImageSharpFluid
          }
        }
      }
    }       
  `)
  const sources = [
    data.mobileImage.childImageSharp.fluid,
    {
      ...data.desktopImage.childImageSharp.fluid,
      media: `(min-width: 768px)`,
    },
  ]
  return (
    <div className={styles.mainContainer} id="testDivID">
      <Img fluid={sources} />
      {/* <div
        id="homeSec1_Overlay"
        className={styles.overlayContainer}
        onMouseEnter={() => {
          document.getElementById("homeSec1_Overlay").classList.toggle(styles.overlayContainer_clear)
        }}
        onMouseLeave={() => {
          document.getElementById("homeSec1_Overlay").classList.toggle(styles.overlayContainer_clear)
        }}>
        <div className={styles.dot}>
          <div className={styles.dot_dot}></div>
        </div>
        <div
          className={styles.overlay}
          style={{}}>
        </div>
      </div> */}
      <SVG_1_1 data={data} />
    </div >
  )
}

const SVG_1_1 = ({ data }) => (
  <div
    style={{
      position: "absolute",
      top: 0,
      left: 0,
      width: "100%",
      height: "100%",
    }} >
    <div
      style={{
        position: "absolute",
        top: "6.9vw",
        left: "5.9vw",
        width: "6.6vw",
        height: "4vw",
        backgroundColor: "#fff",
        zIndex: 100,
        filter: "blur(10px)",
      }} />
    <div
      style={{
        position: "absolute",
        zIndex: 10,
        width: "100%",
        height: "100%",
        mixBlendMode: "color",
      }}>
      <svg
        className={styles.svg1}
        style={{
          filter: "blur(40px)",
          width: "100%",
          height: "100%"
        }}
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 100% 100%">
        <path
          className={styles.path1}
          id="Path_1"
          data-name="Path 1"
          d="M399.5,36.944c147.385,0,193.975,38.284,263.357,157.286C697.131,253.016,799,326.247,799,399.5c0,97.742-235.254,139.117-293.429,208.414C432.177,695.339,522.4,674.707,399.5,674.707c-220.638,0-211.195-78.852-211.195-299.49S178.862,36.944,399.5,36.944Z"
          opacity="0.67" />
        <path
          id="Path_2"
          data-name="Path 2"
          d="M243.561,572.58c461.71,0,334.78-190.231,334.78,281.42S762,1213.517,300.295,1213.517,0,1325.651,0,854-218.149,572.58,243.561,572.58Z" transform="translate(201.494 -384.656)"
          fill="#ffc42e"
          opacity="0.69" />
      </svg>
    </div >
  </div>

);

export default section;
